import React, {Component} from 'react';
class Footer extends Component {
    render(){
        return(
            <div>
                <header>
                <h1>VietTraverller</h1>
                </header>
                <section>
                    <h2>Trang web preview du lịch Việt Nam</h2>
                    <p>
                        <ul>
                            <li>Tông đài chăm sóc khách hàng:1900 1234</li>
                        </ul>
                    </p>

                </section>
            </div>
            );
        }
}
export default Footer
